import{_ as t,c as o,o as a,a2 as d}from"./chunks/framework.DDIT__tB.js";const u=JSON.parse('{"title":"Setup Guide for Eclipse","description":"","frontmatter":{},"headers":[],"relativePath":"wiki/development/eclipse.md","filePath":"wiki/development/eclipse.md"}'),r={name:"wiki/development/eclipse.md"};function s(i,e,l,n,c,p){return a(),o("div",null,e[0]||(e[0]=[d('<h1 id="setup-guide-for-eclipse" tabindex="-1">Setup Guide for Eclipse <a class="header-anchor" href="#setup-guide-for-eclipse" aria-label="Permalink to &quot;Setup Guide for Eclipse&quot;">​</a></h1><h2 id="_1-download-the-eclipse-product" tabindex="-1">1. Download the Eclipse Product <a class="header-anchor" href="#_1-download-the-eclipse-product" aria-label="Permalink to &quot;1. Download the Eclipse Product&quot;">​</a></h2><p>Download the Eclipse Product from the <a href="/download/">Download Page</a> for your platform. Extract the contained files to a location of your choice.</p><h2 id="_2-create-open-a-workspace" tabindex="-1">2. Create/Open a workspace <a class="header-anchor" href="#_2-create-open-a-workspace" aria-label="Permalink to &quot;2. Create/Open a workspace&quot;">​</a></h2><p>Once Eclipse opens, it will ask you for a location of a workspace. We recommend setting your workspace to a folder where you intent to place all projects depending on the analysis. Select this folder in the dialouge as workspace and press the <code>Launch</code> button.</p><h2 id="_3-importing-projects" tabindex="-1">3. Importing projects <a class="header-anchor" href="#_3-importing-projects" aria-label="Permalink to &quot;3. Importing projects&quot;">​</a></h2><p>If you want to work or modify the analysis directly, you first need to clone the analysis repository to your desired location using <code>git clone</code>. Then use the dialouge at <code>File-&gt;Import-&gt;General-&gt;Existing Projects into Workspace</code> to import the plugins contained in the analysis repository. Select the Folder of the cloned analysis as root directory. Then use the <code>Deselect All</code> button to deselect all found projects and select the following if you need them:</p><table tabindex="0"><thead><tr><th>Project</th><th>Description</th><th>Recommended?</th></tr></thead><tbody><tr><td><code>org.dataflowanalysis.analysis</code></td><td>Core Functionality of the Analysis</td><td>Required</td></tr><tr><td><code>org.dataflowanalysis.analysis.pcm</code></td><td>PCM Functionality of the Analysis</td><td>Required</td></tr><tr><td><code>org.dataflowanalysis.analysis.dfd</code></td><td>DFD Functionality of the Analysis</td><td>Required</td></tr><tr><td><code>org.dataflowanalysis.analysis.tests</code></td><td>Tests of the Analysis</td><td>Required</td></tr><tr><td><code>org.dataflowanalysis.analysis.examplemodels</code></td><td>Example Models</td><td>Required</td></tr><tr><td><code>org.dataflowanalysis.analysis.converter</code></td><td>Model Converter</td><td>Needed for Model Conversion</td></tr><tr><td><code>org.dataflowanalysis.analysis.converter.tests</code></td><td>Tests of the Model Converter</td><td>Needed for Model Conversion</td></tr><tr><td>Projects ending with <code>.feature</code></td><td>Eclipse Feature Plugin</td><td>Do Not Import</td></tr><tr><td>Projects ending with <code>.targetplatform</code></td><td>Eclipse Targetplatform</td><td>Do Not Import</td></tr><tr><td><code>org.dataflowanalysis.dfd.datadictionary.*</code></td><td>Data Dictionary Metamodel</td><td>Only imported when modifed</td></tr><tr><td><code>org.dataflowanalysis.dfd.dataflowdiagram.*</code></td><td>Data Flow Diagram Metamodel</td><td>Only imported when modified</td></tr><tr><td>Projects eding with <code>.mwe2</code></td><td>Automatic Build Scrips for Metamodels</td><td>Do Not Import</td></tr></tbody></table><h2 id="_4-testing-the-setup" tabindex="-1">4. Testing the Setup <a class="header-anchor" href="#_4-testing-the-setup" aria-label="Permalink to &quot;4. Testing the Setup&quot;">​</a></h2><p>If you have imported the <code>org.dataflowanalysis.analysis.tests</code> project, you can run the analysis tests to test your setup. To do that navigate in the file explorer (typically on the left side) to the <code>org.dataflowanalysis.analysis.tests</code> plugin. Right click on the <code>src</code> directory and select <code>Run As-&gt;JUnit Test</code> (do not select <code>JUnit Plug-in Test</code>). If all tests run sucessfully, your development enviornment is setup correctly!</p><h2 id="_5-using-the-analysis" tabindex="-1">5. Using the Analysis <a class="header-anchor" href="#_5-using-the-analysis" aria-label="Permalink to &quot;5. Using the Analysis&quot;">​</a></h2><p>Now that you have setup the analysis locally, you can refer to the guide on running the analysis locally <a href="/wiki/development/running-locally.html">here</a></p>',12)]))}const y=t(r,[["render",s]]);export{u as __pageData,y as default};
